using System.Collections;
using System.Collections.Generic;
using UnityEngine;
using Mirror;
using System.Threading;
using System;






public class Engine : NetworkBehaviour
{

  public List<Character> playerList = new List<Character>();
  public CustomNetworkManager networkManager; // Assign in the Inspector
  public Vector3 spawnPoint = new Vector3(0, 1, 0);
  public BlockManager blockManager;

  public GameObject localPlayerPrefab;

  public static Engine Instance;

  public void AddPlayer(Character player) {
    playerList.Add(player);
    Debug.Log("Player added. Total players: " + playerList.Count);

  }
  [Server]
  void FixedUpdate()
  {
    // Check if this instance is running on the server
    if (!isServer) return;

    Tick();
  }

  [Server]
  void Tick(){
    foreach (Character player in playerList)
    {
      player.HandlePlayer(); // You would define this method in your Player class
      if (player.inventory.slots.Count < 8){
        player.inventory.SpawnNewSlot();
        player.inventory.AddItemToSlot(player.inventory.slots.Count-1,blockManager.GetItemById(player.inventory.slots.Count+53),1);

        //player.inventory.DropItem(player.inventory.slots.Count-1);
      }
      player.vitalStats.cold = Mathf.Max(0, player.vitalStats.cold - 0.03f);
      player.vitalStats.hunger = Mathf.Max(0, player.vitalStats.hunger - 0.03f);

      foreach (Projectile projectile in player.projectiles) {
        projectile.MoveProjectile();
      }

      player.localPlayer.vitalStatsUI.UpdateVitalStats(player.vitalStats);
      
      //player.localPlayer.vitalStatsUI.UpdateVitalStats(player.vitalStats);

    }
  }

  public void buildBlockCmd(string args)
{
    string[] values = args.Split(':');
    if (values.Length == 4) // Ensure there are 4 values provided
    {
        int itemId = int.Parse(values[0]);
        float x = float.Parse(values[1]);
        float z = float.Parse(values[2]);
        int rotation = int.Parse(values[3]);
        
        blockManager.SpawnBlock(itemId, x, z, rotation);
    }
    else
    {
        Console.WriteLine($"Incorrect number of arguments for block command: {args}");
    }
}

  public void ParseCommands(string input)
  {
    string[] commands = input.Split(new char[] {'!'}, StringSplitOptions.RemoveEmptyEntries);

    // Loop through each command and print (or process further)
    foreach (string command in commands)
    {
      Console.WriteLine(command);
      string[] parts = command.Split('=');
      if (parts.Length == 2) // Ensure the command is correctly formatted
      {
        string cmdName = parts[0];
        string cmdValues = parts[1];

        switch (cmdName)
        {
          case "b":
            buildBlockCmd(cmdValues);
            break;
          default:
            Console.WriteLine($"Unknown command: {cmdName} = {cmdValues}");
            break;
        }
      }
    }
  }

